import React from "react";
import ReactDom from "react-dom";

ReactDom.render(
  // React.fragment is a replacement of div in version 16or above
  <React.Fragment>
    <h1>Netflix Best Series </h1>
    <ol>
    <p>Stranger Things</p>
    <p>Sex Education</p>
    <p>Whitcher</p>
    <p>Dark</p>
    <p>Sacred Games</p>
    </ol>
  </React.Fragment>,
  document.getElementById("root")
);
